Travel Documentary hosted by John Beach, published by Travel Channel  in 2014 - English narration


Information
------------------------------

 Luxury Trains 
They're one of the best-kept secrets in the world of first class travel. As exclusive as a private jet, these amazing railroad passenger cars, some faithfully restored, others artfully reimagined, bring the romance of rail travel right into the 21st century. Their private owners have combined passion, perseverance and plenty of cash, to turn these historic cars in the plushest and most luxurious trains on the rails today.

